import "./Home.css";
import Home from "./Home";
import About from "./About";

function App() {
    let Component;
  switch (window.location.pathname) {
    case "/":
        Component = <Home />

    case "/about":
        Component = <About />



    return (
    <>{Component}</>
    );
  }
}

export default App;
